import React from 'react';
import data from '../data.json';
import './Shoppage.css';
import {ProductCard} from 'react-ui-cards';

export default function Shoppage(props) {
    console.log(props.match.params.id);
    const shop = data.shops.find( x => x._id === props.match.params.id);
    return (
        <div>
            <h1>{shop.name}</h1>
            <h3>{shop.description}</h3>

            <ProductCard
            photos={[
                'https://i.imgur.com/jRVDeI8.jpg',
                'https://i.imgur.com/raPe27t.jpg',
                'https://i.imgur.com/IpEsYSH.jpg'
            ]}
            price='$99'
            productName='Headphones'
            description='lzjvklkxzcjvl;;vcxj;zlxcvj;lkjvcz;lkjvcz;lvcxj '
            buttonText='Add to cart'
            rating={3}
            url='https://github.com/nukeop'
            />
        </div>
    )
}
